mapper.select:
  	select count(*) from (select * from torderlist t 
		    	where (t.fs_type = '02' and t.fi_stat = '0') or 
		    			(t.fs_type = '03' and t.fi_stat = '-10') or 
		    			(1=1 
						        and t.fs_oper_id = #{fsOperId}

						 )
			) o left join TCUSTOMINFO c
  			on o.fs_user_id = c.fs_id
	     where 1=1

	        and o.fs_no = #{fsNo}


	        and o.fs_Name like '%'||#{fsName}||'%'


	        and o.fs_Type = #{fsType}


	        and o.fi_Stat = #{fiStat}


	         AND o.fi_Stat <> '32' 


	        and c.fs_Id like '%'||#{fsId}||'%'


	        and c.fs_Taname like '%'||#{fsTaName}||'%'

      select * from (select ROWNUM as rowno, t.* from 
		(select 
		     o.FS_NO, o.FI_GENINDEX, o.FS_NAME, o.FS_USER_ID, o.FS_USER_SUBID,
             o.FS_OPER_ID, to_char(o.FT_CREATDATE, 'yyyy-MM-dd HH24:mi:ss') as FT_CREATDATE, o.FS_TYPE, o.FS_ROUTE_ID, o.FS_PROPERTY,
             o.FI_DAYS, o.FT_STARTDATE, o.FS_STARTPLACE, o.FD_PRICE, o.FS_SUMMARY,
             o.FD_TOTALFEE, o.FD_PAIDAMT, o.FS_REMARK, o.FI_STAT, o.FS_DAC, o.FI_VISITORNUM, o.FD_INSUERPRICE,

		    , c.fs_Id, c.fs_TaName
		from
		    (select * from torderlist t 
		    	where (t.fs_type = '02' and t.fi_stat = '0') or 
		    			(t.fs_type = '03' and t.fi_stat = '-10') or 
		    			(1=1 
						        and t.fs_oper_id = #{fsOperId}

						 )
			) o left join TCUSTOMINFO c
  			on o.fs_user_id = c.fs_id
		    order by FS_NO desc) t
    	where 1=1

	        and t.fs_no = #{fsNo}


	        and t.fs_Name like '%'||#{fsName}||'%'


	        and t.fs_Type = #{fsType}


	        and t.fi_Stat = #{fiStat}


	         AND t.fi_Stat <> '32' 


	        and t.fs_Id like '%'||#{fsId}||'%'


	        and t.fs_Taname like '%'||#{fsTaName}||'%'


	        and ROWNUM <= #{endrow}

	      ) tt where 1=1

	        and tt.rowno > #{startrow}
